import axios from "axios";
import { url } from './../constants/auth'

export const Login = async (username, password) => {
    try {
        const res = await axios.post(url + "/auth/login", {
            username,
            password
        });
        return res.data;
    } catch (error) {
        if (error) {
            console.log(error);
            return false;
        }
    }
}
